column8:
まっすぐな針では縫いにくいところをすくって縫えます！<br><br>

バッグやキルトの飾りつけ、布箱やぬいぐるみの縫い合わせに。<br>
Cタイプ(ゆるいカーブ)2本、Uタイプ(きついカーブ)2本。<br><br>

◆種類・内容：ノーマルポイント 各4本入<br>
◆P.サイズ：45×125×3mm<br><br>

※モニターによって実物のお色と若干異なる場合がございます。<br /><br />※メーカー希望小売価格はメーカーカタログに基づいて掲載しています
