布通りを極めた黒い針！<br><br>

プロ仕様の研磨あげ針と特殊黒メッキ仕上げで生まれた極上の布通り。<br>
摩擦抵抗値を大幅に軽減しました。<br>
上質な鋼を厳選し、素材の特性を十分に発揮する焼入れ、焼戻しを行うことにより針軸を強化。<br>
硬さと弾力性のベストバランスを追求して、曲がりにくく、折れにくい針軸が生まれました。<br>
特殊黒メッキで錆びに強く、通常のニッケルメッキ仕上げよりも、さらに防錆性能が向上しています。<br><br>

◆内容：10本入
◆種類：太さ0.53mm　長さ24.4mm<br>
◆P.サイズ：48×125×3mm<br><br>

